import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {
  Box,
  Container,
  Divider,
  Typography,
  Card,
  CardHeader,
  CardContent,
  CardActions,
  Avatar,
  Button,
} from '@material-ui/core';
import ExpansionCard from '../components/ExpansionPanel.js';
import TopMenuBar from '../components/TopMenuBar.js'
import {LinkContainer} from 'react-router-bootstrap';
import NodeIcon from "../icons/icon_node.js";
import RouterIcon from '@material-ui/icons/Router';
import PersonIcon from '@material-ui/icons/Person';





const useStyles = makeStyles(theme => ({
  heading: {
    fontSize: theme.typography.pxToRem(15),
    fontWeight: theme.typography.fontWeightRegular,
  },
  section1: {
    margin: theme.spacing(2),
  },
  avatarColor:{
    backgroundColor:'#fff',
  },
}));

export default function SimpleExpansionPanel() {
  const classes = useStyles();

  return (
    <Container fixed>
      <TopMenuBar block pageName="FAQ" hamburgerMenu={false} closeButtonOnly={false} closeWithPrompt={false} backButton={true} backRoutePage="/"/>
      <Card className={classes.section1}>
        <CardHeader
          avatar={
            <Avatar className={classes.avatarColor} aria-label="nodes">
              <NodeIcon color="primary" />
            </Avatar>
          }
          title="Nodes"
          />
          <CardContent>
            <Typography variant="body2">
              Do you have any problems with your nodes? Please navigate here
            </Typography>
          </CardContent>
          <CardActions>
            <LinkContainer to="/faq/node">
              <Button size="small">Press here</Button>
            </LinkContainer>
          </CardActions>
      </Card>
      <Card className={classes.section1}>
        <CardHeader
          avatar={
            <Avatar className={classes.avatarColor} aria-label="nodes">
              <RouterIcon color="primary" />
            </Avatar>
          }
          title="Gateway"
          />
          <CardContent>
            <Typography variant="body2">
              Do you have any problems with your nodes? Please navigate here
            </Typography>
          </CardContent>
          <CardActions>
            <LinkContainer to="/faq/node">
              <Button size="small">Press here</Button>
            </LinkContainer>
          </CardActions>
      </Card>
      <Card className={classes.section1}>
        <CardHeader
          avatar={
            <Avatar className={classes.avatarColor} aria-label="nodes">
              <PersonIcon color="primary" />
            </Avatar>
          }
          title="Profile"
          />
          <CardContent>
            <Typography variant="body2">
              Do you have any problems with your nodes? Please navigate here
            </Typography>
          </CardContent>
          <CardActions>
            <LinkContainer to="/faq/node">
              <Button size="small">Press here</Button>
            </LinkContainer>
          </CardActions>
      </Card>
    </Container>
  );
}
